package com.practice;

public class DelTwo {

	/**
	 * debcbacda
	 */
	public static void main(String[] args) {
		StringBuffer a = new StringBuffer("");
		int t = (int) Math.floor(1d/0.33333);
		int n = 100000;//100000;
		for(int i = 0; i < n; i++)
			a.append("aabaacabac");
		long s = System.currentTimeMillis();
		System.out.println(new DelTwo().delTwo(a.toString()));
		System.out.println("Time:" + ((System.currentTimeMillis() - s)));
		s = System.currentTimeMillis();
		System.out.println(new DelTwo().delTwo1(a.toString()));
		System.out.println("Time:" + ((System.currentTimeMillis() - s)));
	}

	String delTwo(String a) {
		StringBuffer s = new StringBuffer(a);
		int i = 0, j = 1, n = s.length();
		while (i < n && j < n) {
			while (i >= 0 && j < n && s.charAt(i) == s.charAt(j)) {
				i--;
				j++;
			}

			if (j - i > 1) {
				s.delete(i + 1, j);
				n = s.length();
				i = i < 0 ? 0 : i;
				j = i + 1;
			} else {
				i++;
				j++;
			}
		}
		return s.toString();
	}

	String delTwo1(String a) {
		int i = 0, n = a.length();
		if (n <= 1)
			return a;
		String r = "";
		while (i < n) {
			if (i + 1 < n && a.charAt(i) == a.charAt(i + 1)) {
				a = a.substring(0, i) + (i + 2 < n ? a.substring(i + 2, n) : "");
				return delTwo(a);
			} else {
				r += a.charAt(i);
			}
			i++;
		}
		return r;
	}
}
